import React from "react";
import { ListGroup } from "reactstrap";

const Menu=()=>{

    return(
        <ListGroup>

            <link tag="a" to="/" action>Home</link>
            <link tag="a" to="/addCourse" action>Add Course</link>
            <link tag="a" to="/viewCourse" action>View Course</link>
            <link tag="a" to="/about" action>About</link>
            <link tag="a" to="/contact" action>Contact</link>
        </ListGroup>
    );
}

export default Menu;
